import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

import QuantitySelector from './App.js';
function App() {
  return (
    <div className="App">
      <QuantitySelector />
    </div>
  );
}
const rootElement = document.getElementById("root");
ReactDOM.render(<App />, rootElement);
